    "text28": "Versuchen, unbefugten Zugriff auf diese Website und/oder Dienste, andere Konten, Computersysteme oder Netzwerke zu erlangen, die mit einem Vidqu-Server oder mit Web-Eigenschaften und/oder Diensten verbunden sind, durch Hacking, Passwort-Mining oder auf andere Weise.",
