    "text60": "SIE ERKENNEN AN, DASS DIE ÜBERMITTLUNG VON INFORMATIONEN AUF DER WEBSITE ODER ÜBER DIE Vidqu-ANWENDUNGEN AUF IHR EIGENES RISIKO ERFOLGT. Vidqu übernimmt keinerlei Haftung Ihnen gegenüber hinsichtlich etwaiger Verluste oder Haftungen, die in irgendeiner Weise mit derartigen Informationen in Zusammenhang stehen.",
    "text61": "EINIGE DER AUF DER WEBSITE ODER ÜBER DIE Vidqu-ANWENDUNGEN ANGEGEBENEN INHALTE KÖNNEN MATERIALIEN ENTHALTEN, DIE DRITTEN GEHÖREN ODER VON DRITTEN BEREITGESTELLT WERDEN. SIE ERKENNEN AN, DASS Vidqu KEINE VERANTWORTUNG FÜR DERARTIGE INHALTE, PRODUKTE UND/ODER DIENSTLEISTUNGEN ÜBERNIMMT.",
    "text62": "Wir behalten uns das Recht vor, unseren Service und alle Dienste oder Materialien, die wir über die Plattform bereitstellen, nach eigenem Ermessen und ohne Vorankündigung zurückzuziehen oder zu ändern. Wir haften nicht, wenn aus irgendeinem Grund die gesamte oder ein Teil der Plattform zu irgendeinem Zeitpunkt oder für irgendeinen Zeitraum nicht verfügbar ist. Von Zeit zu Zeit können wir Ihren Zugriff auf einige Teile der Plattform oder auf die gesamte Plattform einschränken.",
    "text63": "UNTER KEINEN UMSTÄNDEN HAFTEN WIR, UNSERE VERBUNDENEN UNTERNEHMEN ODER UNSERE LIEFERANTEN IHNEN GEGENÜBER FÜR: (A) INDIREKTE, SPEZIELLE, ZUFÄLLIGE ODER FOLGESCHÄDEN; (B) DIEBSTAHL PERSÖNLICH IDENTIFIZIERBARER INFORMATIONEN ODER KOSTEN FÜR DIE BESCHAFFUNG VON ERSATZSOFTWARE ODER -DIENSTEN UND (C) SCHÄDEN DURCH ENTGANGENE GEWINNE, VERLUST VON GOODWILL, VERLUST VON PERSONALGEHÄLTERN, ARBEITSUNTERBRECHUNGEN, COMPUTERAUSFÄLLE ODER -FEHLER, DATENVERLUST ODER FAHRLÄSSIGKEIT JEGLICHER ART ODER FÜR ANDERE NICHT DIREKTE SCHÄDEN ODER VERLUSTE.",
    "text64": "IN KEINEM FALL ÜBERSTEIGT UNSERE, UNSERE VERBUNDENEN UNTERNEHMEN ODER UNSERE LIEFERANTEN GESAMTHAFTUNG IHNEN GEGENÜBER FÜR DIREKTE SCHÄDEN DEN PREIS, DEN SIE FÜR DIE ENTSPRECHENDE SOFTWARE ODER DIENSTE BEZAHLT HABEN, ODER 10 US-DOLLAR (ODER DEN ENTSPRECHENDEN BETRAG IN LANDESWÄHRUNG).",
    "text65": "SIE STIMMEN ZU, Vidqu, SEINE FÜHRUNGSKRÄFTE, DIREKTOREN, MITARBEITER, MITGLIEDER, PARTNER, VERTRETER UND LIEFERANTEN SOWIE DEREN JEWEILIGE VERBUNDENE UNTERNEHMEN, FÜHRUNGSKRÄFTE, DIREKTOREN, MITARBEITER, MITGLIEDER, AKTIONÄRE, PARTNER UND VERTRETER VON JEGLICHEN UND ALLEN ANSPRÜCHEN UND KOSTEN, EINSCHLIESSLICH ANWALTSKOSTEN, DIE AUS IHRER NUTZUNG DER INHALTE UND DIENSTE ENTSTEHEN, SCHADLOS ZU HALTEN, EINSCHLIESSLICH ABER NICHT BESCHRÄNKT AUF IHRE VERLETZUNG DIESER VEREINBARUNG. WIR KÖNNEN NACH UNSEREM ALLEINIGEN ERMESSEN DIE AUSSCHLIESSLICHE VERTEIDIGUNG UND KONTROLLE ÜBER ALLE ANGELEGENHEITEN ÜBERNEHMEN, DIE IHRER SCHADLOSHALTUNG UNTERLIEGEN. DIE ÜBERNAHME EINER SOLCHEN VERTEIDIGUNG ODER KONTROLLE DURCH WIR KÖNNEN SIE JEDOCH VON IHRER SCHADENSERSATZPFLICHT NICHT ENTSCHULDIGEN.",
    "text66": "Die Bedingungen dieser Servicebedingungen unterliegen den Gesetzen der Sonderverwaltungszone Hongkong der Volksrepublik China, mit Ausnahme der Kollisionsnormen. Alle Käufe, die über einen der Online-Shops von Vidqu getätigt werden, unterliegen diesen Servicebedingungen und den für diesen Kauf geltenden Verkaufsbedingungen. Die meisten Kundenanliegen können über das Online-Supportcenter von Vidqu gelöst werden. Für den Fall, dass Vidqu eine Beschwerde nicht zu Ihrer Zufriedenheit lösen kann, senden Sie bitte eine Mitteilung an <a href='mailto:support@vidqu.ai'>support@vidqu.ai</a>.",
    "text67": "Sie können uns unter <a href='mailto:support@vidqu.ai'>support@vidqu.ai</a> direkt Informationen und Feedback zu Fehlern, Verbesserungsvorschlägen, Ideen, Problemen, Beschwerden und anderen Angelegenheiten im Zusammenhang mit unserer Plattform („Feedback“) zukommen lassen.",
    "text68": "Sie erkennen an und stimmen zu, dass: (i) Sie keine geistigen Eigentumsrechte oder andere Rechte, Titel oder Interessen an dem Feedback behalten, erwerben oder geltend machen; (ii) wir das Feedback verwenden können, um die Plattform oder eine andere Technologie zu verbessern; (iii) wir möglicherweise ähnliche Entwicklungsideen wie das Feedback haben; (iv) das Feedback keine vertraulichen Informationen oder geschützten Informationen von Ihnen oder Dritten enthält; und (v) wir unterliegen keiner Geheimhaltungspflicht in Bezug auf das Feedback.",
    "text69": "Sie gewähren Vidqu und seinen verbundenen Unternehmen hiermit ein exklusives, übertragbares, unwiderrufliches, kostenloses, gebührenfreies, unterlizenzierbares, unbegrenztes und unbefristetes Recht, das Feedback in jeglicher Weise und für jeglichen Zweck zu verwenden (einschließlich Kopieren, Ändern, Erstellen abgeleiteter Werke, Veröffentlichen, Verteilen und Kommerzialisieren).",
    "text70": "Keine der Parteien haftet gegenüber der anderen für die Nichterfüllung einer Verpflichtung aus einer Vereinbarung, die auf ein Ereignis zurückzuführen ist, das außerhalb der Kontrolle dieser Partei liegt, einschließlich, aber nicht beschränkt auf höhere Gewalt, Terrorismus, Krieg, politischen Aufstand, Aufruhr, Unruhen, Handlungen ziviler oder militärischer Autorität, Aufstände, Erdbeben, Überschwemmungen oder andere natürliche oder vom Menschen verursachte Ereignisse außerhalb unserer Kontrolle, die zur Kündigung einer geschlossenen Vereinbarung oder eines geschlossenen Vertrags führen oder die vernünftigerweise vorhersehbar waren. Jede von einem solchen Ereignis betroffene Partei informiert die andere Partei unverzüglich darüber und unternimmt alle angemessenen Anstrengungen, um die Bedingungen der hierin enthaltenen Vereinbarung einzuhalten. Datenverluste oder Schäden, die durch höhere Gewalt verursacht wurden, werden nicht ersetzt.",
    "text71": "Sollte eine Bestimmung dieser Servicebedingungen für ungültig oder nicht durchsetzbar befunden werden, ist diese Bestimmung in Übereinstimmung mit geltendem Recht so auszulegen, dass sie die ursprüngliche Absicht der Bestimmung widerspiegelt, und die übrigen Bestimmungen dieser Servicebedingungen bleiben in vollem Umfang in Kraft und wirksam. Ein Versäumnis, ein Recht oder eine Bestimmung dieser Servicebedingungen auszuüben oder durchzusetzen, stellt keinen Verzicht auf dieses Recht oder diese Bestimmung dar.",
    "text72": "INDEM SIE DEN SERVICE ODER ANDERE VON UNS BEREITGESTELLTE SERVICES VERWENDEN, BESTÄTIGEN SIE, DASS SIE DIESE BEDINGUNGEN GELESEN HABEN UND SICH MIT IHRER VERBINDUNG EINVERSTANDEN ERKLÄREN.",
    "text73": "Sollten Sie Fragen zu dieser Mitteilung haben oder Vidqu aus irgendeinem Grund kontaktieren wollen, senden Sie uns bitte eine E-Mail an <a href='mailto:support@vidqu.ai'>support@vidqu.ai</a>.",
